import React from "react";

function Transaction({TransactionObj, handleDeletion}){
    const {id,date,descripion,category,amount} = TransactionObj;
    return(
        <tr onClick={()=> handleDeletion(id)}>
            <td>{date}</td>
            <td>{descripion}</td>
            <td>{category}</td>
            <td>{amount}</td>
        </tr>
    );
}

export default Transaction;
